import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
    providedIn: 'root'
})
export class LecturerService {

    constructor(private http: HttpClient) { }

    getLecturers() {
        return this.http.get('http://localhost:8080/lecturers');
    }
}
